CREATE TABLE TB_UC3M_INV_JUST_AGRUPACION (
  NUMIDAGRUPACION	INT			NOT NULL COMMENT 'Identificador de la agrupación de proyectos que se incluye en una misma generación de archivo de justificación.',
  NUMIDESTADO     	INT   		NOT NULL COMMENT 'Identificador del estado de la agrupación.',
  DATLANZAMIENTO  	DATETIME	NULL COMMENT 'Fecha del último lanzamiento para la generación del archivo de justificación. No se guarda histórico.',
  NUMREGISTROS      INT     	NULL COMMENT 'Número total de registros de la agrupación.',
  NUMFACTURAS	    INT     	NULL COMMENT 'Número de registros de facturas de la agrupación.',
  NUMPERSONAL       INT     	NULL COMMENT 'Número de registros de personal de la agrupación.',
  NUMOTROS		    INT     	NULL COMMENT 'Número de registros de otros gastos de la agrupación.',
  NUMERRORES	    INT     	NULL COMMENT 'Número de registros con errores detectados en la agrupación.',
  PRIMARY KEY (NUMIDAGRUPACION),
  INDEX AGRUPACION_FECHA (DATLANZAMIENTO),
  INDEX AGRUPACION_ESTADO (NUMIDESTADO),
  FOREIGN KEY JUST_AGRUPACION_ESTADO_FK (NUMIDESTADO) REFERENCES TB_UC3M_INV_JUST_ESTADOS_AGR (NUMIDESTADO)
) COMMENT 'Tabla que contiene las agrupaciones de proyectos utilizadas para los lanzamientos de generación de los ficheros de la justificación';


COMMIT;
